// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

contract Immutable {
    // 45696
    // address public owner = msg.sender;
    address public immutable owner = msg.sender;
    uint public x;

    function example () external {
        require (owner == msg.sender, "not owner");
        x += 1;
    }
}

